import React from "react";
import Avatar from '@mui/material/Avatar';
import Container from '@mui/material/Container';
import SpaIcon from '@mui/icons-material/Spa';
import { AppBar, Button, ButtonGroup } from "@mui/material";
import { AccessAlarm, ThreeDRotation } from '@mui/icons-material';
import AdbIcon from '@mui/icons-material/Adb';
export default function Navbar({ conBoton, color, funcionLogin }) {
    return (
        <AppBar position="static">
            <Container maxWidth="xl">
            <Avatar sx={{ bgcolor: green[500] }}><SpaIcon /></Avatar>
                <ButtonGroup variant="contained" aria-label="outlined primary button group">
                <Button><a href="http://google.com">Plantas</a></Button>
                <Button><a href="http://google.com">ir a google</a></Button>
                <Button><a href="http://google.com">ir a google</a></Button>
            </ButtonGroup>
            <ul>
                <li>
                <a href="http://google.com">ir a google</a>
                </li>
                <li>
                    <a href="http://google.com">ir a google</a>
                </li>
                <li>
                    <a href="http://google.com">ir a google</a>
                </li>
                <li>
                    <a href="http://google.com">ir a google</a>
                </li>
            </ul>
            {conBoton ? <button onClick={() => funcionLogin()}>LOGIN</button> : null}
            </Container>
        </AppBar>


    );
}
